const morning = new Date(2020, 20,10, )
const Afternoon = new Date()
const Night = new Date()
if (time>morning){
    document.write("Good Morning")
}
else if (time>Afternoon){
    document.write("Good Afternoon")
}
else{
    document.write("Good Night")
}

